import React from 'react'
import './animacion.css'
import Imagen from './Carrousel.jpg'

const Carrousel = () => {

    return(

          <img src={Imagen} className='carrousel' style={{margin: '1px solid #ddd'}}></img>         
          )
}

export default Carrousel;
